public class Solution {
    /**
     * @param root: A Tree
     * @return: Preorder in ArrayList which contains node values.
     */

    public List preorderTraversal(TreeNode root) {
        // write your code here
        List list = new ArrayList<>();
        if(root == null){
            return list;
        }
        Stack s = new Stack<>();
        s.push(root);
        while(!s.isEmpty()){
            TreeNode node = s.pop();
            list.add(node.val);
            if(node.right != null){
                s.push(node.right);
            }

            if(node.left != null){
                s.push(node.left);
            }
        }
        return list;
    }
}

