public class Solution {
    /**
     * @param root: A Tree
     * @return: Inorder in ArrayList which contains node values.
     */
    public List inorderTraversal(TreeNode root) {
        // write your code here
        List list = new ArrayList<>();
        if(root == null){
            return list;
        }
        TreeNode p = root;
        Stack stack = new Stack<>();
        while(p != null){
            stack.push(p);
            p = p.left;
        }
        while(!stack.isEmpty()){
            p = stack.pop();
            list.add(p.val);
            if(p.right != null){
                p = p.right;
                while(p != null){
                    stack.push(p);
                    p = p.left;
                }
            }
        }
        return list;
    }
}

