public boolean helper(int curr, int parent, HashMap> map, boolean[] visited){
    //已经走过,说明有环
    if(visited[curr])
        return false;

    visited[curr] = true;

    for(int i: map.get(curr)){
        if(i!=parent && !helper(i, curr, map, visited)){
            return false;
        }
    }   

    return true;
}

